import React from "react";
// import CountUp from "react-countup/build/CountUp";


function Count(){
    return(
        // <p> From Count.js</p>
        <CountUp start={0} end={100}>
        {({ countUpRef, start }) => (
          <div>
            <span ref={countUpRef} />
            <button onClick={start}>Start</button>
          </div>
        )}
      </CountUp>
    )
}

export default Count;
